import {Container} from 'react-bootstrap'
import React from 'react'
import Task from './../Task/Task'

class TodoList extends React.Component {
    constructor() {
        super()
        this.state = {
            tasks:[
                {"task":"SS",
                 "isDone":false},
                 {"task":"dd",
                 "isDone":false},
                 {"task":"aa",
                 "isDone":false},
                 {"task":"gg",
                 "isDone":false},
            ]
        }
    }
    render() {
      return (
      <Container>
          <h1>TODO LIST</h1>
          {this.state.tasks.map(task => <Task dataFromParent={task}></Task>)}
      </Container>
        );
    }
  }

  export default TodoList;
